    private string searchTerm;

    private async Task Search()
    {
        characters.Clear();
        foreach (var character in characters)
        {
            if (character.Name.IndexOf(searchTerm, StringComparison.OrdinalIgnoreCase) >= 0)
            {
                characters.Add(character);
            }
        }
    }
